import React from 'react';

const SearchJobs: React.FC = () => {
  return (
    <div className="bg-white rounded-lg shadow-sm p-10">
      <div className="text-center max-w-2xl mx-auto">
        <h2 className="text-[#6B46C1] text-2xl font-semibold mb-8">
          Find Your Dream Job
        </h2>
        <div className="relative">
          <div className="absolute inset-y-0 left-4 flex items-center pointer-events-none">
            <svg className="w-5 h-5 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" />
            </svg>
          </div>
          <input
            type="text"
            placeholder="Search for jobs, companies, or keywords"
            className="w-full px-12 py-4 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-purple-500 focus:border-transparent"
          />
        </div>
      </div>
    </div>
  );
};

export default SearchJobs;
